import { Fragment, useState } from "react";
import { NavLink, Form, useRouteLoaderData } from "react-router-dom";
import Avatar1 from "./assets/chooseyou-logo-header-2.svg";
import Avatar2 from "./assets/chooseyou-hamburger-menu.svg";

import {
  motion,
  useScroll,
  useTransform,
  AnimatePresence,
} from "framer-motion";

import BookingSignup from "./BookingSignup";
import classes from "./MainNavigation.module.css";

function MainNavigation() {
  const [showNav, setShowNav] = useState(false);

  const navMenu = () => {
    setShowNav(!showNav);
  };
  const transition_text = { duration: 0.5, ease: "easeInOut" };

  const calendly = (
    <div>
      <div
        className={classes.calendly}
        data-url="https://calendly.com/jcianci1?background_color=f2f8f9&text_color=fcff6d&primary_color=f4e573"
      ></div>
      <script
        type="text/javascript"
        src="https://assets.calendly.com/assets/external/widget.js"
        async
      ></script>
    </div>
  );

  return (
    <>
      <AnimatePresence>
        {showNav && (
          <motion.div
            key="nav_text"
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={transition_text}
            exit={{ opacity: 0 }}
            className={classes.listContainer}
            id="navBody"
          >
            <motion.div
              className={classes.listOuter}
              onClick={navMenu}
            ></motion.div>
            <motion.div className={classes.listLineBreak}></motion.div>
            <motion.ul className={classes.list}>
              <motion.li className={classes.listElement}>
                <NavLink
                  to="/"
                  className={({ isActive }) =>
                    isActive ? classes.active : undefined
                  }
                  end
                >
                  Home
                </NavLink>
              </motion.li>
              <motion.li className={classes.listElement}>
                <NavLink
                  to="/coaching"
                  className={({ isActive }) =>
                    isActive ? classes.active : undefined
                  }
                >
                  Coaching
                </NavLink>
              </motion.li>
              {/* <li className={classes.listElement}>
            <NavLink
              to="/yoga"
              className={({ isActive }) =>
                isActive ? classes.active : undefined
              }
            >
              Yoga
            </NavLink>
          </li> */}
              <motion.li className={classes.listElement}>
                <NavLink
                  to="/about"
                  className={({ isActive }) =>
                    isActive ? classes.active : undefined
                  }
                >
                  About
                </NavLink>
              </motion.li>
              <BookingSignup />
            </motion.ul>
          </motion.div>
        )}
      </AnimatePresence>
      <header className={classes.header_1}>
        <nav className={classes.navContainer}>
          <div className={classes.logoContainer}>
            <img className={classes.logo} src={Avatar1} />
          </div>
          <div className={classes.menuContainer}>
            <img onClick={navMenu} className={classes.menu} src={Avatar2} />
          </div>
        </nav>
      </header>
    </>
  );
}

export default MainNavigation;
